import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Wyznaczanie dominanty
        </p>
       <form onSubmit={handleClick}>
        <ThemeProvider theme={theme}>
        <form className={classes.root} noValidate autoComplete="off">
        <TextField id="txtf-numbers" label="Wpisz cyfry po przecinku" value={numbers} required variant="filled" color="secondary" onInput={e => setRadius(e.target.value)}/>
        <TextField id="txtf-price" label="Price" value={price} required variant="filled" color="primary" onInput={e => setPrice(e.target.value)}  />
        </form>
        <form className={classes.root} theme={theme}>
                <Button variant="contained" color="primary" type="submit">
          Calculate!
        </Button>
        </form>
        <form>
        {error ? <h4>{error}</h4> : <h4>{profitability ?  `You pay ${profitability} for a square meter.`  : 'Waiting for orders!'}</h4>}

        </form>

        </ThemeProvider>
        </form>
      </header>
    </div>
  );
}

export default App;
